                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) * ( - ( (HCO_C2H3) &
                 - (C2H5_C2H3) * (HCO_C2H5)) * (CH2_HCO) / ( (1.0_pr) &
                 - (C2H5_HCO) * (HCO_C2H5))) / ( ( (1.0_pr) &
                 - (C2H5_C2H3) * (C2H3_C2H5)) - ( (HCO_C2H3) &
                 - (C2H5_C2H3) * (HCO_C2H5)) * ( (C2H3_HCO) &
                 - (C2H5_HCO) * (C2H3_C2H5)) / ( (1.0_pr) - (C2H5_HCO) &
                 * (HCO_C2H5)))) * cqss(sqssCH2GSG) - ( ( (CH2_CH) &
                 - (HCO_CH) * (CH2_HCO) / ( (1.0_pr) - (C2H5_HCO) &
                 * (HCO_C2H5))) - ( (C2H3_CH) - (HCO_CH) * ( (C2H3_HCO) &
                 - (C2H5_HCO) * (C2H3_C2H5)) / ( (1.0_pr) - (C2H5_HCO) &
                 * (HCO_C2H5))) * ( - ( (HCO_C2H3) - (C2H5_C2H3) &
                 * (HCO_C2H5)) * (CH2_HCO) / ( (1.0_pr) - (C2H5_HCO) &
                 * (HCO_C2H5))) / ( ( (1.0_pr) - (C2H5_C2H3) &
                 * (C2H3_C2H5)) - ( (HCO_C2H3) - (C2H5_C2H3) &
                 * (HCO_C2H5)) * ( (C2H3_HCO) - (C2H5_HCO) * (C2H3_C2H5)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5)))) * cqss(sqssCH)) &
                 / ( (1.0_pr) - (HCO_CH2) * (CH2_HCO) / ( (1.0_pr) &
                 - (C2H5_HCO) * (HCO_C2H5)))  

    cqss(sqssC2H3) = ( ( (C2H3_ct) - (C2H5_ct) * (C2H3_C2H5)) - ( (HCO_ct) &
                 - (C2H5_ct) * (HCO_C2H5)) * ( (C2H3_HCO) - (C2H5_HCO) &
                 * (C2H3_C2H5)) / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5)) &
                 - ( ( (C2H3_CH2CO) - (C2H5_CH2CO) * (C2H3_C2H5)) &
                 - ( (HCO_CH2CO) - (C2H5_CH2CO) * (HCO_C2H5)) &
                 * ( (C2H3_HCO) - (C2H5_HCO) * (C2H3_C2H5)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) * cqss(sqssCH2CO) &
                 - ( ( (C2H3_HCCO) - (C2H5_HCCO) * (C2H3_C2H5)) &
                 - ( (HCO_HCCO) - (C2H5_HCCO) * (HCO_C2H5)) &
                 * ( (C2H3_HCO) - (C2H5_HCO) * (C2H3_C2H5)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) * cqss(sqssHCCO) &
                 - ( ( (C2H3_CH3O) - (C2H5_CH3O) * (C2H3_C2H5)) &
                 - ( (HCO_CH3O) - (C2H5_CH3O) * (HCO_C2H5)) &
                 * ( (C2H3_HCO) - (C2H5_HCO) * (C2H3_C2H5)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) * cqss(sqssCH3O) &
                 - ( ( (C2H3_CH2OH) - (C2H5_CH2OH) * (C2H3_C2H5)) &
                 - ( (HCO_CH2OH) - (C2H5_CH2OH) * (HCO_C2H5)) &
                 * ( (C2H3_HCO) - (C2H5_HCO) * (C2H3_C2H5)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) * cqss(sqssCH2OH) &
                 - ( ( (C2H3_CH2GSG) - (C2H5_CH2GSG) * (C2H3_C2H5)) &
                 - ( (HCO_CH2GSG) - (C2H5_CH2GSG) * (HCO_C2H5)) &
                 * ( (C2H3_HCO) - (C2H5_HCO) * (C2H3_C2H5)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) * cqss(sqssCH2GSG) &
                 - ( (C2H3_CH) - (HCO_CH) * ( (C2H3_HCO) - (C2H5_HCO) &
                 * (C2H3_C2H5)) / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))) &
                 * cqss(sqssCH) - ( - (HCO_CH2) * ( (C2H3_HCO) &
                 - (C2H5_HCO) * (C2H3_C2H5)) / ( (1.0_pr) - (C2H5_HCO) &
                 * (HCO_C2H5))) * cqss(sqssCH2)) / ( ( (1.0_pr) &
                 - (C2H5_C2H3) * (C2H3_C2H5)) - ( (HCO_C2H3) &
                 - (C2H5_C2H3) * (HCO_C2H5)) * ( (C2H3_HCO) &
                 - (C2H5_HCO) * (C2H3_C2H5)) / ( (1.0_pr) - (C2H5_HCO) &
                 * (HCO_C2H5)))  

    cqss(sqssHCO) = ( (HCO_ct) - (C2H5_ct) * (HCO_C2H5) - ( (HCO_CH2CO) &
                 - (C2H5_CH2CO) * (HCO_C2H5)) * cqss(sqssCH2CO) &
                 - ( (HCO_HCCO) - (C2H5_HCCO) * (HCO_C2H5)) &
                 * cqss(sqssHCCO) - ( (HCO_CH3O) - (C2H5_CH3O) &
                 * (HCO_C2H5)) * cqss(sqssCH3O) - ( (HCO_CH2OH) &
                 - (C2H5_CH2OH) * (HCO_C2H5)) * cqss(sqssCH2OH) &
                 - ( (HCO_CH2GSG) - (C2H5_CH2GSG) * (HCO_C2H5)) &
                 * cqss(sqssCH2GSG) - (HCO_CH) * cqss(sqssCH) &
                 - (HCO_CH2) * cqss(sqssCH2) - ( (HCO_C2H3) &
                 - (C2H5_C2H3) * (HCO_C2H5)) * cqss(sqssC2H3)) &
                 / ( (1.0_pr) - (C2H5_HCO) * (HCO_C2H5))  

    cqss(sqssC2H5) = C2H5_ct - (C2H5_CH2CO) * cqss(sqssCH2CO) - (C2H5_HCCO) &
                 * cqss(sqssHCCO) - (C2H5_CH3O) * cqss(sqssCH3O) &
                 - (C2H5_CH2OH) * cqss(sqssCH2OH) - (C2H5_CH2GSG) &
                 * cqss(sqssCH2GSG) - (C2H5_C2H3) * cqss(sqssC2H3) &
                 - (C2H5_HCO) * cqss(sqssHCO)  

    cqss(sqssC) = C_ct - (C_CH) * cqss(sqssCH)  

    do index = 1, nqss
      cqss(index) = max(cqss(index), 1e-60_pr)
      cqss(index) = min(cqss(index), 1e60_pr)
    end do
    
    return
  end subroutine get_qss  
  
    
  ! ----------------------------------------------- !
  ! Mass fractions to concentrations                !
  ! ----------------------------------------------- !
  subroutine y2c(y, W_sp, P, T, c)
    implicit none

    real(pr),dimension(nspec) :: W_sp
    real(pr),dimension(nspec) :: c, y
    real(pr) :: rho, P, T, inv_W_g

    integer :: k
            
    ! Gas molecular weight inverse
    inv_W_g = 0.0_pr
    do k =1, nspec
      inv_W_g = inv_W_g + y(k) / W_sp(k)
    end do

    ! Gas density
    rho = P / (Rcst * inv_W_g * T)

    ! Conversion
    c = y * rho / W_sp

    ! Concentrations clipping
    !do k =1, nspec
    !  c(k) = max(c(k), 1e-60_pr)
    !end do

        return
    end subroutine y2c

end module mod_customkinetics
! ----------------------------------------------- !
! Cantera routine                                 !
! ----------------------------------------------- !
subroutine customkinetics(P, T, y, wdot)

  use mod_customkinetics
  implicit none

  real(pr), dimension(nspec) :: y, c, wdot, cdot
  real(pr), dimension(nqss) :: cqss
  real(pr), dimension(nreac + nreac_reverse) :: w,k
  real(pr), dimension(nTB + nFO) :: M

  real(pr) :: P, T, rho

  ! Convert to concentrations
  call y2c(y, W_sp, P, T, c)

  ! Evaluate QSS concentrations and reaction rates
  call get_thirdbodies(M,c)

  call get_rate_coefficients(k, M, T, P)
  call get_qss(cqss, c, k, M)

  call get_reaction_rates(w, k, M, c, cqss)

  ! Evaluate production rates
  call get_production_rates(wdot,w)

  return
end subroutine customkinetics

